from PIL import Image
from io import BytesIO
import base64

bits = ""
bits = bits + "0" * (106*17 - len(bits))
img = Image.new("1", (106, 17), color=1)
for i in range(106*17):
    img.putpixel((i // 17, 16 - (i % 17)), int(bits[i] == "0"))

img = img.resize((106 * 4, 17 * 4))

# formats = ["BMP", "GIF", "PNG", "WEBP", ]
# for f in formats:
#     fio = BytesIO()
#     img.save(fio, f)
#     print(f, fio.tell())

fio = BytesIO()
img.save(fio, "png")
b64 = base64.b64encode(fio.getvalue())
print("data:image/png;base64," + (b64.decode()))